import React from "react";
import { Link } from "react-router-dom";

export const Navbar = () => {
    return (
        <nav>
			<ul>
				<li>   

            <Link to="/">Office</Link>
				</li>
			</ul>
            <Link to="/">College</Link>
            <Link to="/">Developers</Link>
            <Link to="/">Family</Link>
        </nav>
    );
};
